import inputComponentGroup from "~/data/ui_frameworks/material_ui/component_groups/Inputs";
import { component as buttonComponent } from "~/data/ui_frameworks/material_ui/components/Button";
import { TComponentGroup } from "~/interfaces/material_components";

const componentGroups: TComponentGroup[] = [
  {
    iconType: "user",
    title: "Layout",
    components: [
      { title: "Box", props: [] },
      { title: "Container", props: [] },
      { title: "Grid", props: [] }
    ]
  },
  inputComponentGroup,
  {
    iconType: "user",
    title: "Navigation",
    components: [
      { title: "Bottom Navigation", props: [] },
      { title: "Breadcrumbs", props: [] },
      { title: "Drawer", props: [] },
      { title: "Link", props: [] },
      { title: "Menu", props: [] },
      { title: "Stepper", props: [] },
      { title: "Tabs", props: [] }
    ]
  },
  {
    iconType: "user",
    title: "Surfaces",
    components: [
      { title: "App Bar", props: [] },
      {
        title: "Paper",
        props: [
          {
            name: "children",
            default: null
          },
          {
            name: "classes",
            default: null
          },
          {
            name: "component",
            default: "div"
          },
          {
            name: "elevation",
            default: 1
          },
          {
            name: "square",
            default: false
          },
          {
            name: "variant",
            default: "elevation"
          }
        ]
      },
      { title: "Card", props: [] },
      { title: "Expansion Panel", props: [] }
    ]
  },
  {
    iconType: "user",
    title: "Feedback",
    components: [
      { title: "Progress", props: [] },
      { title: "Dialog", props: [] },
      { title: "Snackbar", props: [] },
      { title: "Backdrop", props: [] }
    ]
  },
  {
    iconType: "user",
    title: "Data Display",
    components: [
      { title: "Avatar", props: [] },
      { title: "Badge", props: [] },
      { title: "Chip", props: [] },
      { title: "Divider", props: [] },
      { title: "Icons", props: [] },
      { title: "Material Icons", props: [] },
      { title: "List", props: [] },
      { title: "Table", props: [] },
      { title: "Tooltip", props: [] },
      { title: "Typography", props: [] }
    ]
  }
];

export default componentGroups;
